import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router";
import Main from "./main/Main";
import Join from "./join/Join";

function App() {
  return (
      <BrowserRouter>
          <Routes>
            <Route path="/" exact={true} element={<Main />} />
            <Route path="/join" element={<Join />} />
          </Routes>
      </BrowserRouter>
  );
}

export default App;
